import { Route, Routes } from "react-router-dom";
import { ToastContainer } from "react-toastify";
import Signin from "./components/Pages/Signin";
import Signup from "./components/Pages/Signup";
import Home from "./components/Pages/Home";
import Scrollup from "./components/Scrollup";
import ProjectsPath from "./components/Pages/Projects/ProjectsPaths";
import Projects from "./components/Pages/Projects/AllProjects";
import UserProjects from "./components/Pages/Projects/ProjectCRUD/UserProjects";
import AddProject from "./components/Pages/Projects/ProjectCRUD/AddProject";
import UpdateProject from "./components/Pages/Projects/ProjectCRUD/UpdateProject";
import Footer from "./components/Footer";
import Nav from "./components/Nav";
import "./a"
import { useState } from "react";

export default function App() {
  const [request, setRequest] = useState(0);
  const [login, setLogin] = useState(false);
  const [search, setSearch] = useState(false);
  const [searchTerm, setSearchTerm] = useState("");
  const [dark, setDark] = useState(true);


  return (
    <div className="app" style={{ backgroundColor:dark ? "#e0eff5" : '#00468B'}}>
    <Nav dark={dark} setDark={setDark} request={request} login={login} setLogin={setLogin} search={search} setSearch={setSearch} setSearchTerm={setSearchTerm} searchTerm={searchTerm}/> 
      <ToastContainer />
      <Routes>
        <Route exact path="/" element={<Home dark={dark} />} />
        <Route exact path="/signin" element={<Signin dark={dark} setLogin={setLogin} login={login}  />} />
        <Route exact path="/signup" element={<Signup dark={dark} />} />
        <Route exact path="/projects" element={<ProjectsPath />} />
        <Route exact path="/projects/:type" element={<Projects setRequest={setRequest} request={request} setSearch={setSearch} search={search} setSearchTerm={setSearchTerm} searchTerm={searchTerm}/>} />
        <Route exact path="/myprojects" element={<UserProjects dark={dark}/>} /> 
        <Route exact path="/myprojects/add" element={<AddProject dark={dark} />} />
        <Route exact path="/myprojects/edit/:id" element={<UpdateProject dark={dark}/>} />
      </Routes>
      <Scrollup />
      <Footer dark={dark}/>
    </div>

  );
}
